<!DOCTYPE html>
<html lang="pt-br">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
		<meta http-equiv="X-UA-Compatible" content="ie=edge">
		<link href="https://fonts.googleapis.com/css?family=Montserrat:400,700&display=swap" rel="stylesheet"> 

    <title>Página Não Encontrada &#183; Apiki Wordpress</title>

		<style>
			html, body, h1, p {
				margin: 0;
				padding: 0;
			}

			body {
				font-family: 'Montserrat', sans-serif;
				max-height: 100vh;
			}

			.page-container {
				display: flex;
				flex-direction: column;
				justify-content: center;
				align-items: center;
				background-color: #fcfcfc;
				text-align: center;
				padding: 0 10px;
				height: 100vh;
			}

			.image img {
				margin: 20px 0;
				width: 100%;
				max-width: 430px;
			}

			.info, .support {
				display: flex;
				flex-direction: column;
				align-items: center;
			}

			.info__title {
				font-size: 36px;
				color:#009bdb;
			}

			.info__text {
				font-size: 14px;
				color: #67666a;
				line-height: 1.3;
				max-width: 442px;
				margin: 15px 0;
			}

			.support {
				width: 100%;
			}

			.support__link {
				font-size: 12px;
				color: #009bdb;
				text-decoration: none;
				margin: 20px;
			}

			.support__link-detail {
				color:#67666a;
			}

			.support__image {
				margin-top: 20px;
				width: 27px;
				height: 27px;
			}

			@media (max-width: 520px ) {
				.info__title {
					font-size: 24px;
				}
			}

			@media (max-width: 320px) {
				.support__link {
					display: block;
					margin: 5px;
				}

				.support__link-detail {
					display: none;
				}
			}

		</style>
</head>
